CowboyRule_winning_hands_desc:
ผู้เล่นสามารถลงเดิมพันมือใดก็ได้จากห้าประเภทที่ชนะรางวัล;
a) ไพ่สูง, หนึ่งคู่;
b) สองคู่;
c) การเดินทาง, สเตรท, ฟลัช;
d) ฟูลเฮ้าส์;
e) ควอด, สเตรทฟลัช, รอยัลฟลัช
รางวัลของผู้เล่นจะเป็นไปตามอัตราต่อรองของแต่ละเดิมพันที่ถูกต้อง

CowboyRule_anyone_holecards_desc_1:
